import React from 'react'
import Card from '@material-ui/core/Card'
import { useNavigate } from 'react-router-dom'

const MenuLink = (props) => {

	const navigateToLink = (onPress) => {
		props.onPress.run()
		const navigate = useNavigate()
   		navigate(props.onPress.link)
	}
	

	return (
		<Card className="menulink noselect" style={{
			height:120,
			background:"#f1f1f1",
			textAlign: "center",
			display: "flex",
			textDecoration:"none",
			width:400

		}}>
			<h1>{props.titel}</h1>
			<button onClick={navigateToLink(props.onPress)}>{props.beschreibung}</button>
		</Card>
	)
}
export default MenuLink
